This allows user-defined type guards for specific objects.

Example code illustrating the issue:

```
interface MyInterface {
  property: number;
}

function logProperty(value: MyInterface) {
  if(angular.isObject(value) {
    console.log(value.property);
  }
}
```

Without generics value is cast to `Object` and type check fails.

# Environment

Nodejs 4.5.0
# Description

I used this code to look up existing properties in Nodejs:

```
const constants = require('constants');
for (var c in constants)
    console.log("\texport var " + c + ": " + typeof constants[c] + ";");
```

However, according to these properties, I used this code to generate related tests:

```
const constants = require('constants');
for (var c in constants){
    switch (typeof constants[c]) {
        case "string":
            console.log(`\tstr = constants.${c}`);
            break;
        case "number":
            console.log(`\tnum = constants.${c}`);
            break;
    }
}
```
